	add("shaanxi", "{\"term\":\"shaanxi\", \"etymology\":{\"influencers\":[], \"languages\":[\"mandarin chinese\", \"English\"], \"text\":\"From Mandarin chinese {{zh-k|陝西}}. By regular Hanyu Pinyin rules, if tone marks are not written, both Shaanxi and the neighbouring province of Shanxi, to the east of Shaanxi, should be spelled \u0026quot;Shanxi\u0026quot;; the difference is in tone: Shānxī and Shǎnxī. To make the difference clear without tonal marks, the spelling \u0026quot;Shaanxi\u0026quot; was contrived (following the Gwoyeu Romatzyh romanization system developed by {{w|Yuen Ren Chao}} in 1925-1926) for the province of Shǎnxī, while \u0026quot;Shanxi\u0026quot; is used for the province of Shānxī. Shaanxi is the official romanization used on the Chinese Government\u0027s official Web portal. This makes \u0026quot;Shaanxi\u0026quot; the only name of Chinese provinces that has not been romanized according to pinyin rules.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a north-central province of the People\u0027s Republic of China, and includes portions of the Loess Plateau on the middle reaches of the Yellow River as well as the Qinling Mountains across the southern part of the province\", \"priority\":1}]}, \"synonyms\":{}}");

