	add("shamateur", "{\"term\":\"shamateur\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027\u0027 + \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sportsman who is officially an amateur but who makes money from playing, or who otherwise behaves as a professional\", \"priority\":1}]}, \"synonyms\":{}}");

	add("shamba", "{\"term\":\"shamba\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Swahili\"], \"text\":\"From Swahili\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An area of cultivated ground; a plot of land, a small subsistence farm for growing crops and fruit-bearing trees, often including the dwelling of the farmer\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1967\u0027\u0027, Ngugi wa Thiong\u0027o, \u0027A Grain of Wheat\u0027, EAEP 2008, p. 4\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"To reach his new strip of \u0027\u0027shamba\u0027\u0027 which lay the other side of Thabai, Mugo had to walk through the dusty village streets\", \"priority\":3}]}, \"synonyms\":{}}");

	add("shambles", "{\"term\":\"shambles\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"Latin\"], \"text\":\"From Old english (ca. 450-1100) \u0027scamul\u0027 A borrowing from \u0027scamellum\u0027 diminutive of Latin \u0027scamnum\u0027 (bench)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"work done in a poor fashio\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a scene of great disorder or rui\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"a great mess or clutte\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"This website is a \u0027\u0027shambles\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"a scene of bloodshed, carnage or devastatio\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"a slaughterhous\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"a butcher\u0027s sho\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Jonathan Swif\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"As to our city of Dublin, \u0027\u0027shambles\u0027\u0027 may be appointed for this purpose in the most convenient parts of it, and butchers we may be assured will not be wanting\", \"priority\":9}]}, \"synonyms\":{}}");

