	add("shamisen", "{\"term\":\"shamisen\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Japanese\"], \"text\":\"From Japanese \u0027三味線\u0027 \u0026lt;!-- From Japanese \u0027三味線\u0027 from Chinese 三弦 \u0027sānxián\u0027, from \u0027sān\u0027 ‘three’ + \u0027xián\u0027 ‘string’. --\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A kind of three-stringed Japanese fretless lute\", \"priority\":1}]}, \"synonyms\":{}}");

	add("shamrock", "{\"term\":\"shamrock\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Irish\", \"Georgian\", \"old norse\", \"old irish (to 900)\"], \"text\":\"From Irish {{m|ga|seamróg}}, from Old irish (to 900) {{m|sga|semróc}}, diminutive of {{m|ga|semar}}, {{m|ga|semair||clover}}, from Proto-celtic {{m|cel-pro|*semarā}}, {{m|cel-pro|*semaris}} (compare Gaulish {{m|cel-gau|uisumaris||clover}}), possibly from Proto-indo-european {{m|ine-pro|*semh₁r-}}, {{m|ine-pro|*smeh₁r-}}. Related to Old norse {{m|non|smári||clover}} and possibly Georgian {{m|ka|სამყურა||clover}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The trefoil leaf of any small clover, especially \u0027Trifolium repens\u0027, or such a leaf from a clover-like plant\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"She wore a \u0027\u0027shamrock\u0027\u0027 in honor of her Irish ancestry\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Any of several small plants, forms of clover, with trefoil leaves, especially \u0027Trifolium repens\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The fields were covered with \u0027\u0027shamrocks\", \"priority\":4}]}, \"synonyms\":{}}");

	add("shamshir", "{\"term\":\"shamshir\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Persian\"], \"text\":\"From Persian \u0027شمشیر|tr\u003dšamšīr\u0027 (sword)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A Persian curved blade without a pommel\", \"priority\":1}]}, \"synonyms\":{}}");

	add("shand", "{\"term\":\"shand\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"German\", \"English\", \"middle english (1100-1500)\", \"Dutch\"], \"text\":\"From Middle english (1100-1500) \u0027shande\u0027 \u0027schande\u0027 \u0027schonde\u0027 from Old english (ca. 450-1100) \u0027sceand\u0027 \u0027scand\u0027 (shame, disgrace, infamy, ignominy, confusion; a shameful, infamous, or abominable thing; that which brings disgrace, scandal, disgraceful thing; a bad or infamous person, a buffoon, charlatan, wretch, imposter, recreant) from Proto-germanic {{m|gem-pro|*skandō||shame, disgrace}}, from Proto-indo-european {{m|ine-pro|*(s)ḱem-||to cover, hide, conceal}}. Cognate with Dutch \u0027schande\u0027 (shame, disgrace, reproach, dishonour, scandal) German \u0027schande\u0027 (shame, disgrace, ignominity, dishonour) Related to {{l|en|shame}}, {{l|en|shend}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Shame; scandal; disgrace\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Base coin\", \"priority\":2}]}, \"synonyms\":{}}");

	add("shane", "{\"term\":\"shane\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Irish\"], \"text\":\"English form of a Northern Irish pronunciation of Irish \u0027lang\u003dga\u0027 an equivalent of \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027 L.L.Steinmetz - W.T.Brooks, \u0027How to Sell at Margins Higher Than Your Competitor\u0027, John Wiley\u0026amp;Sons, ISBN 1118040619\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Back in ancient Hollywood history, there was an extremely well-known movie titled \u0027\u0027\u0027Shane\u0027\u0027\u0027. It was a classic western in which the late Alan Ladd played the title role. The most famous scene is the last one in the film, when \u0027\u0027Shane\u0027\u0027 is riding off into the sunset and the little kid is chasing after him yelling, \u0026quot;\u0027\u0027Shane\u0027\u0027, come back, \u0027\u0027Shane\u0027\u0027!\u0026quot\", \"priority\":2}]}, \"synonyms\":{}}");

	add("shandy", "{\"term\":\"shandy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A drink made by mixing beer and lemonade\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A glass of this drink\", \"priority\":2}]}, \"synonyms\":{}}");

	add("shannon", "{\"term\":\"shannon\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The longest river in the British Isles, which flows through Ireland into the Atlantic Ocean\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"of origin, variant of Shanahan, anglicised from\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"from the surname or from the river\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1896\u0027\u0027 \u0027Report of the Commission to Locate the Site of the Frontier Forts of Pennsylvania\u0027, C.M.Busch, state printer, 1896, page 28\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Captain Samuel \u0027\u0027Shannon\u0027\u0027 is frequently mentioned in the public records, and he had something more than a local reputation. He must have been very popular, as the name \u0026quot;\u0027\u0027Shannon\u0027\u0027\u0026quot; as a Christian name is so common throughout the valley as to be noticeable\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"derived from the river; first used in the USA in early 20th century, and only recently in Ireland\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027 Andrew M. Greeley, Mary G. Durkin, \u0027The Book of Love\u0027, Macmillan, 2005, ISBN 0312878389, pages 193-19\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Everything in my life is okay except I have this terrible problem with my sister \u0027\u0027Shannon\u0027\u0027. I\u0027m spelling her name the way most people would. She spells it Sionna ever since the priest told us that\u0027s the real Irish way to spell it. It\u0027s the name of a river and a goddess. Shanny doesn\u0027t think she\u0027s a river. She\u0027s really \u0027\u0027Shannon\u0027\u0027 Marie\", \"priority\":8}]}, \"synonyms\":{}}");

	add("shaojiu", "{\"term\":\"shaojiu\", \"etymology\":{\"influencers\":[], \"languages\":[\"mandarin chinese\", \"English\"], \"text\":\"From pinyin transliteration of Mandarin chinese 燒酒, 烧酒 (shāojiǔ).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A clear, Chinese distilled alcoholic beverage, generally about 40-60% alcohol by volume, usually distilled from sorghum\", \"priority\":1}]}, \"synonyms\":{}}");

	add("shapelet", "{\"term\":\"shapelet\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|shape|let|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A stylized shape used in pattern recognition systems to correspond to a real object\", \"priority\":1}]}, \"synonyms\":{}}");

