	add("shaping", "{\"term\":\"shaping\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The action of the verb \u0027\u0027to shape\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027, Mike Michael, \u0027Constructing Identities: The Social, the Nonhuman and Change\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In contrast to the (to be sure, productive) \u0027\u0027shapings\u0027\u0027 and constrainings of human identities in the sociotechnical network, here we have an expansion of identity\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A method of positive reinforcement of behaviour patterns in operant conditioning\", \"priority\":4}]}, \"synonyms\":{}}");

	add("sharn", "{\"term\":\"sharn\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"Danish\", \"English\", \"middle english (1100-1500)\", \"northern frisian\", \"Icelandic\", \"Swedish\"], \"text\":\"From Middle english (1100-1500) \u0027scharn\u0027 from Old english (ca. 450-1100) \u0027scearn\u0027 (sharn, dung, muck, filth) from Proto-germanic {{m|gem-pro|*skarną||manure}}, from Proto-indo-european {{m|ine-pro|*sker-||dung, manure}}. Cognate with Northern frisian \u0027skern\u0027 (dung, manure) Danish Swedish and Icelandic \u0027skarn\u0027 (dung)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The dung or manure of cattle\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1932\u0027\u0027, \u0027Sunset Song\u0027, Polygon 2006 (\u0027A Scots Quair\u0027), p. 19\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"right between the byre and the stable and the barn on one side and the house on the other was the cattle-court and right in the middle of that the midden, high and yellow with dung and straw and \u0027\u0027sharn\u0027\u0027, and Mistress Strachan could never forgive Peesie\u0027s Knapp because of that awful smell it had\", \"priority\":3}]}, \"synonyms\":{}}");

	add("sharab", "{\"term\":\"sharab\", \"etymology\":{\"influencers\":[], \"languages\":[\"Arabic\", \"English\", \"Persian\"], \"text\":\"From Persian \u0027شراب|tr\u003dsharāb|lang\u003dfa\u0027 () from Arabic \u0027شَرَاب\u0027 (wine, beverage) from \u0027شَرَبَ\u0027 (to drink)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Wine, or other alcoholic drinks\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Michael Chabon, \u0027Gentlemen of the Road\u0027, Sceptre 2008, p. 49\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In the meantime, the black giant had begun his own survey of the campground, where three nights earlier Hanukkah and his fellows had shared a roast goat and a looted cask of \u0027\u0027sharab\", \"priority\":3}]}, \"synonyms\":{}}");

