	add("shareware", "{\"term\":\"shareware\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|share|ware|lang\u003den}}; popularized by w:Bob Wallace|Bob Wallace\u0026lt;ref\u0026gt;{{cite web|url\u003dhttp://www.takeourword.com/TOW176/page2.html|title\u003dTake Our Word For It|date\u003d2002-11-14|work\u003dWords to the Wise, Issue 176|publisher\u003dThe Institute for Etymological Research and Education|accessdate\u003d2008-09-08}}\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of software that is distributed without payment but is limited in any combination of functionality, availability, or convenience\", \"priority\":1}]}, \"synonyms\":{}}");

	add("sharkdom", "{\"term\":\"sharkdom\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|shark|dom|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being a shark, or of belonging to the world of sharks; sharks, collectively\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1868\u0027\u0027, Isabelle Saxon, \u0027Five years within the Golden gate\u0027, page 215\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Having once tasted blood, \u0027\u0027sharkdom\u0027\u0027, like despotism, kept a look-out for victims to devour by \u0026quot;right divine\u0026quot; in any unhappy waifs or strays of humanity daring enough to venture into the water\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027, Philip Z. Trupp, \u0027Sea of Dreamers: Travels with Famous Ocean Explorers\u0027, page 166\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"How strange to discover the only novel to be Peter Benchley\u0027s outrageous tale of demonic \u0027\u0027sharkdom\u0027\u0027, \u0027Jaws\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Thomas B. Allen, \u0027Shark Attacks: Their Causes and Avoidance\u0027, page 5\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"McHenry had been pilloried as an enemy of \u0027\u0027sharkdom\u0027\u0027 after he had caught four large great whites at the Farallons in a single day in 1982\", \"priority\":7}]}, \"synonyms\":{}}");

	add("sharpster", "{\"term\":\"sharpster\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|sharp|ster|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A swindler; someone who is adept at conning others; a con artist\", \"priority\":1}]}, \"synonyms\":{}}");

